import React, { useEffect, useRef, useCallback } from 'react';
import * as d3 from 'd3';
import { Cpu, Wrench, Zap, Activity } from 'lucide-react';
import { renderToString } from 'react-dom/server';

const GraphComponent = ({ data }) => {
  const svgRef = useRef(null);
  const simulationRef = useRef(null);
  const nodesRef = useRef([]);
  const linksRef = useRef([]);
  const linkSelectionRef = useRef(null);
  const nodeSelectionRef = useRef(null);
  const particleGroupRef = useRef(null);

  // Get icon SVG string based on node type
  const getIconSvg = (type, status) => {
    const color = status === 'running' ? '#00ffff' : '#f59e0b';
    let IconComponent;

    switch (type) {
      case 'main':
        IconComponent = Cpu;
        break;
      case 'sub-agent':
        IconComponent = Activity;
        break;
      case 'tool':
        IconComponent = Wrench;
        break;
      default:
        IconComponent = Zap;
    }

    const svgString = renderToString(<IconComponent size={20} color={color} />);
    return `data:image/svg+xml;base64,${btoa(svgString)}`;
  };

  // Initialize or update simulation
  const updateGraph = useCallback(() => {
    if (!svgRef.current) return;

    const svg = d3.select(svgRef.current);
    const width = svgRef.current.clientWidth;
    const height = svgRef.current.clientHeight;

    // Initialize data structures if empty
    if (nodesRef.current.length === 0) {
      nodesRef.current = data.nodes.map(n => ({ ...n }));
      linksRef.current = data.links.map(l => ({ ...l }));
    } else {
      // Merge new nodes without losing positions
      const existingNodeIds = new Set(nodesRef.current.map(n => n.id));

      // Add new nodes
      data.nodes.forEach(newNode => {
        if (!existingNodeIds.has(newNode.id)) {
          nodesRef.current.push({ ...newNode, x: width / 2, y: height / 2 });
        } else {
          // Update status on existing nodes
          const existing = nodesRef.current.find(n => n.id === newNode.id);
          if (existing) existing.status = newNode.status;
        }
      });

      // Remove nodes no longer present
      const newNodeIds = new Set(data.nodes.map(n => n.id));
      nodesRef.current = nodesRef.current.filter(n => newNodeIds.has(n.id));

      // Update links
      linksRef.current = data.links.map(l => ({ ...l }));
    }

    // Create or update simulation
    if (!simulationRef.current) {
      simulationRef.current = d3.forceSimulation(nodesRef.current)
        .force('link', d3.forceLink(linksRef.current).id(d => d.id).distance(100))
        .force('charge', d3.forceManyBody().strength(-300))
        .force('center', d3.forceCenter(width / 2, height / 2))
        .force('collision', d3.forceCollide().radius(d => (d.type === 'main' ? 45 : d.type === 'sub-agent' ? 35 : 25)));
    } else {
      simulationRef.current.nodes(nodesRef.current);
      simulationRef.current.force('link').links(linksRef.current);
      simulationRef.current.alpha(0.3).restart();
    }

    // Render links
    const linkGroup = svg.select('.links').empty() 
      ? svg.append('g').attr('class', 'links')
      : svg.select('.links');

    linkSelectionRef.current = linkGroup
      .selectAll('line')
      .data(linksRef.current, d => `${d.source.id || d.source}-${d.target.id || d.target}`);

    linkSelectionRef.current.exit().remove();

    const linkEnter = linkSelectionRef.current
      .enter()
      .append('line')
      .attr('stroke', '#333')
      .attr('stroke-width', 2);

    linkSelectionRef.current = linkEnter.merge(linkSelectionRef.current);

    // Render nodes
    const nodeGroup = svg.select('.nodes').empty()
      ? svg.append('g').attr('class', 'nodes')
      : svg.select('.nodes');

    nodeSelectionRef.current = nodeGroup
      .selectAll('g')
      .data(nodesRef.current, d => d.id);

    nodeSelectionRef.current.exit().transition().duration(300).attr('opacity', 0).remove();

    const nodeEnter = nodeSelectionRef.current
      .enter()
      .append('g')
      .attr('class', d => `node ${d.status === 'running' ? 'pulsing' : ''}`)
      .call(d3.drag()
        .on('start', dragstarted)
        .on('drag', dragged)
        .on('end', dragended));

    // Add glow ring for running nodes
    nodeEnter
      .append('circle')
      .attr('class', 'glow-ring')
      .attr('r', d => d.type === 'main' ? 40 : d.type === 'sub-agent' ? 30 : 20)
      .attr('fill', 'none')
      .attr('stroke', d => d.status === 'running' ? '#00ffff' : 'transparent')
      .attr('stroke-width', 2)
      .attr('opacity', d => d.status === 'running' ? 1 : 0);

    // Add main circle
    nodeEnter
      .append('circle')
      .attr('r', d => d.type === 'main' ? 32 : d.type === 'sub-agent' ? 24 : 16)
      .attr('fill', '#1a1a1a')
      .attr('stroke', d => d.status === 'running' ? '#00ffff' : '#f59e0b')
      .attr('stroke-width', 2);

    // Add icon
    nodeEnter
      .append('image')
      .attr('xlink:href', d => getIconSvg(d.type, d.status))
      .attr('x', d => d.type === 'main' ? -10 : d.type === 'sub-agent' ? -8 : -6)
      .attr('y', d => d.type === 'main' ? -10 : d.type === 'sub-agent' ? -8 : -6)
      .attr('width', d => d.type === 'main' ? 20 : d.type === 'sub-agent' ? 16 : 12)
      .attr('height', d => d.type === 'main' ? 20 : d.type === 'sub-agent' ? 16 : 12);

    // Add label
    nodeEnter
      .append('text')
      .text(d => d.name)
      .attr('dy', d => d.type === 'main' ? 50 : d.type === 'sub-agent' ? 40 : 30)
      .attr('text-anchor', 'middle')
      .attr('fill', '#888')
      .attr('font-size', '10px')
      .attr('font-family', 'monospace');

    nodeSelectionRef.current = nodeEnter.merge(nodeSelectionRef.current);

    // Update existing nodes
    nodeSelectionRef.current.select('.glow-ring')
      .attr('stroke', d => d.status === 'running' ? '#00ffff' : 'transparent')
      .attr('opacity', d => d.status === 'running' ? 1 : 0)
      .attr('class', d => `glow-ring ${d.status === 'running' ? 'pulse-animation' : ''}`);

    nodeSelectionRef.current.select('circle:not(.glow-ring)')
      .attr('stroke', d => d.status === 'running' ? '#00ffff' : '#f59e0b');

    nodeSelectionRef.current.select('image')
      .attr('xlink:href', d => getIconSvg(d.type, d.status));

    // Particle group for marching ants effect
    if (particleGroupRef.current && particleGroupRef.current.empty()) {
      particleGroupRef.current = svg.append('g').attr('class', 'particles');
    }

    // Simulation tick
    simulationRef.current.on('tick', () => {
      if (linkSelectionRef.current) {
        linkSelectionRef.current
          .attr('x1', d => d.source.x)
          .attr('y1', d => d.source.y)
          .attr('x2', d => d.target.x)
          .attr('y2', d => d.target.y);
      }

      if (nodeSelectionRef.current) {
        nodeSelectionRef.current.attr('transform', d => `translate(${d.x},${d.y})`);
      }
    });

    // Drag functions
    function dragstarted(event, d) {
      if (!event.active) simulationRef.current.alphaTarget(0.3).restart();
      d.fx = d.x;
      d.fy = d.y;
    }

    function dragged(event, d) {
      d.fx = event.x;
      d.fy = event.y;
    }

    function dragended(event, d) {
      if (!event.active) simulationRef.current.alphaTarget(0);
      d.fx = null;
      d.fy = null;
    }
  }, [data]);

  // Create particle effects on active links
  useEffect(() => {
    if (!svgRef.current || !data.links.length) return;

    const svg = d3.select(svgRef.current);
    const particleGroup = svg.select('.particles').empty() 
      ? svg.append('g').attr('class', 'particles')
      : svg.select('.particles');

    // Clear old particles
    particleGroup.selectAll('*').remove();

    // Create particles on active links
    data.links.forEach((link, i) => {
      if (link.active) {
        const particle = particleGroup
          .append('circle')
          .attr('r', 3)
          .attr('fill', '#00ffff');

        animateParticle(particle, link, i * 200);
      }
    });

    function animateParticle(particle, link, delay) {
      const sourceNode = nodesRef.current.find(n => n.id === (link.source.id || link.source));
      const targetNode = nodesRef.current.find(n => n.id === (link.target.id || link.target));

      if (!sourceNode || !targetNode) return;

      particle
        .attr('cx', sourceNode.x)
        .attr('cy', sourceNode.y)
        .attr('opacity', 0)
        .transition()
        .delay(delay)
        .duration(1000)
        .ease(d3.easeLinear)
        .attr('opacity', 1)
        .attrTween('transform', function() {
          return function(t) {
            const x = sourceNode.x + (targetNode.x - sourceNode.x) * t;
            const y = sourceNode.y + (targetNode.y - sourceNode.y) * t;
            return `translate(${x - sourceNode.x},${y - sourceNode.y})`;
          };
        })
        .on('end', () => animateParticle(particle, link, 0));
    }
  }, [data]);

  // Initialize and update
  useEffect(() => {
    updateGraph();
  }, [updateGraph]);

  // Cleanup on unmount
  useEffect(() => {
    return () => {
      if (simulationRef.current) {
        simulationRef.current.stop();
      }
    };
  }, []);

  return (
    <svg
      ref={svgRef}
      className="w-full h-full"
      style={{ background: 'transparent' }}
    />
  );
};

export default GraphComponent;
